import React from "react";

export default function WhatNewHomepage() {
  return (
    <div className="wn-page">
      <style>{`
        .wn-page {
          font-family: Inter, system-ui, Segoe UI, Roboto, 'Helvetica Neue', Arial;
          color: #111;
          background: linear-gradient(135deg, #f8fafc 0%, #f1f5f9 100%);
        }
        .wn-container {
          max-width: 1200px;
          margin: 0 auto;
          padding: 40px 20px;
        }
        .wn-section {
          display: flex;
          align-items: center;
          gap: 40px;
          padding: 60px 0;
          flex-wrap: wrap;
        }
        .wn-section .wn-image {
          flex: 1 1 480px;
          min-height: 260px;
          background-size: cover;
          background-position: center;
          border-radius: 12px;
          box-shadow: 0 10px 30px rgba(2, 6, 23, 0.08);
        }
        .wn-section .wn-content {
          flex: 1 1 420px;
        }
        .wn-hey {
          display: inline-block;
          padding: 6px 12px;
          background: linear-gradient(90deg, #06b6d4, #7c3aed);
          color: white;
          border-radius: 999px;
          font-weight: 600;
          margin-bottom: 12px;
        }
        .wn-title {
          font-size: 28px;
          line-height: 1.05;
          margin: 6px 0 12px;
          font-weight: 700;
        }
        .wn-desc {
          color: #334155;
          margin-bottom: 18px;
        }
        .wn-cta {
          display: inline-flex;
          align-items: center;
          gap: 10px;
          padding: 12px 18px;
          border-radius: 10px;
          background: #0ea5a4;
          color: white;
          font-weight: 700;
          border: none;
          cursor: pointer;
          box-shadow: 0 6px 18px rgba(14, 165, 164, 0.18);
          text-decoration: none;
          transition: all 0.3s ease;
        }
        .wn-cta:hover {
          background: #0891b2;
        }
        .wn-cta.secondary {
          background: transparent;
          border: 2px solid #e6eef6;
          color: #0f172a;
          font-weight: 700;
        }
        .wn-cta.secondary:hover {
          border-color: #94a3b8;
        }
        .wn-reverse {
          flex-direction: row-reverse;
        }
        .wn-cards {
          display: flex;
          gap: 18px;
          flex-wrap: wrap;
          margin-top: 8px;
        }
        .wn-card {
          flex: 1 1 180px;
          background: white;
          border-radius: 12px;
          padding: 18px;
          box-shadow: 0 6px 20px rgba(2, 6, 23, 0.04);
          display: flex;
          align-items: center;
          gap: 12px;
          transition: transform 0.2s ease;
        }
        .wn-card:hover {
          transform: translateY(-4px);
        }
        .wn-card .icon {
          width: 48px;
          height: 48px;
          border-radius: 10px;
          background: #eef2ff;
          display: flex;
          align-items: center;
          justify-content: center;
          font-weight: 700;
          font-size: 22px;
        }

        /* Responsive */
        @media (max-width: 900px) {
          .wn-section {
            padding: 40px 0;
          }
          .wn-title {
            font-size: 22px;
          }
        }
        @media (max-width: 640px) {
          .wn-section {
            flex-direction: column;
          }
          .wn-section.wn-reverse {
            flex-direction: column;
          }
        }
      `}</style>

      <div className="wn-container">
        {/* 1. Right image / Left content */}
        <section className="wn-section wn-reverse">
          <div
            className="wn-image"
            style={{
              backgroundImage: "url(https://picsum.photos/id/1018/1200/800)",
            }}
          />
          <div className="wn-content">
            <span className="wn-hey">What's new</span>
            <h2 className="wn-title">Discover trending products â€” curated for you</h2>
            <p className="wn-desc">
              Hand-picked items from creators and small shops. Fresh arrivals daily, great prices, and fast delivery.
            </p>
            <div style={{ display: "flex", gap: 12 }}>
              <a href="#" className="wn-cta">Shop Now</a>
              <a href="#" className="wn-cta secondary">Learn More</a>
            </div>
          </div>
        </section>

        {/* 2. Left image / Right content */}
        <section className="wn-section">
